import React from 'react'
import Button from 'react-bootstrap/Button';
import ButtonGroup from 'react-bootstrap/Button';

const StatusCard = ({title ,buttons}) =>
{
  
    return (
        <div  >
            <div>{title}</div>
        <div>
        <ButtonGroup className="mr-2" aria-label="First group" style={styles.cardContainer}>
    {buttons.map(button=>(<Button>{button.titleButton}</Button>))}
        </ButtonGroup>
        </div>
        </div>
    )
}

const styles = {
    cardContainer:
    {
        display:"inline",
        display:"flex",

        flexDirection:"row",    // float:"right",
    //     backgroundColor:"green", 
    //    // margin:"auto"
       
    }
}
export default StatusCard;
